describe("Unit testing jQuery version of easy pie chart",function(){var e,t=function(t,i){return t=t||{},i=i||'<span class="chart"></span>',function(){e=$(i),$("body").append(e),e.easyPieChart(t)}};describe("initialize plugin",function(){beforeEach(t()),it("should insert a canvas element",function(){expect(e.html()).toContain("canvas")})}),describe("takes size option and",function(){var i;beforeEach(t({size:200})),beforeEach(function(){i=e.find("canvas")}),it("set correct width",function(){expect(i.width()).toBe(200)}),it("set correct height",function(){expect(i.height()).toBe(200)})}),describe("options should be overwritable by data attributes",function(){var i;beforeEach(t({size:200},'<span class="chart" data-size="400"></span>')),beforeEach(function(){i=e.find("canvas")}),it("overwrite width",function(){expect(i.width()).toBe(400)}),it("overwrite height",function(){expect(i.height()).toBe(400)})})});